const breakpoints = {
  xs: "@media only screen and (max-width: 425px)",
  sm: "@media only screen and (max-width: 767.98px)",
  md: "@media only screen and (max-width: 1023px)",
  lg: "@media only screen and (max-width: 1440px)",
  xl: "@media only screen and (min-width: 1440px) and (max-width: 1720px)",
  xxl: "@media only screen and (min-width: 1720px)",
